import { ReactComponent as Logo } from '../assets/react-logo.svg'

function NavBar() {
    return (
        <div id="container">
            <section>
                <Logo width="40px" />
                <span className="info">ReactFacts</span>
            </section>
        </div>
    );
}

export default NavBar
